DROP TABLE IF EXISTS `branch_products`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `branch_products` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `branch_id` bigint unsigned NOT NULL,
  `product_id` bigint unsigned NOT NULL,
  `stock_quantity` int NOT NULL DEFAULT '0',
  `quantity_of_boxes` int DEFAULT NULL COMMENT 'Number of boxes in stock',
  `quantity_per_box` int DEFAULT NULL COMMENT 'Number of units per box',
  `reorder_level` int NOT NULL DEFAULT '0',
  `price` decimal(10,2) NOT NULL,
  `price_per_kilo` decimal(10,2) DEFAULT NULL COMMENT 'Selling price per kilogram',
  `price_per_box` decimal(10,2) DEFAULT NULL COMMENT 'Selling price per box',
  `weight_unit` enum('kg','g','ton','lb','oz') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Unit for weight-based pricing',
  `price_per_unit_weight` decimal(10,2) DEFAULT NULL COMMENT 'Price per selected weight unit',
  `cost_price` decimal(10,2) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `branch_products_branch_id_foreign` (`branch_id`),
  KEY `branch_products_product_id_foreign` (`product_id`),
  CONSTRAINT `branch_products_branch_id_foreign` FOREIGN KEY (`branch_id`) REFERENCES `branches` (`id`) ON DELETE CASCADE,
  CONSTRAINT `branch_products_product_id_foreign` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=64 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
