  `image` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `quantity_per_box` int DEFAULT NULL COMMENT 'Number of units per box',
  `box_weight` decimal(10,3) DEFAULT NULL COMMENT 'Weight of one box in kg',
  `selling_mode` enum('unit','weight','box','both') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'unit' COMMENT 'How product is sold: unit, weight, box, or both',
  `price` decimal(10,2) DEFAULT NULL COMMENT 'Default selling price per unit',
  `cost_price` decimal(10,2) DEFAULT NULL COMMENT 'Default cost price per unit',
  `price_per_kilo` decimal(10,2) DEFAULT NULL COMMENT 'Default price per kilogram',
  `price_per_box` decimal(10,2) DEFAULT NULL COMMENT 'Default price per box',
  `weight_unit` varchar(10) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Alternative weight unit',
  `price_per_unit_weight` decimal(10,2) DEFAULT NULL COMMENT 'Price per alternative weight unit',
  `total_boxes` int NOT NULL DEFAULT '0' COMMENT 'Total boxes available in warehouse before branch assignment',
  `total_units` int NOT NULL DEFAULT '0' COMMENT 'Total units (total_boxes * quantity_per_box)',
  `assigned_units` int NOT NULL DEFAULT '0' COMMENT 'Units already assigned to branches',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `products_barcode_unique` (`barcode`),
  KEY `products_business_id_foreign` (`business_id`),
  KEY `products_category_id_foreign` (`category_id`),
  KEY `products_primary_supplier_id_foreign` (`primary_supplier_id`),
  KEY `products_added_by_foreign` (`added_by`),
  CONSTRAINT `products_added_by_foreign` FOREIGN KEY (`added_by`) REFERENCES `users` (`id`) ON DELETE SET NULL,
  CONSTRAINT `products_business_id_foreign` FOREIGN KEY (`business_id`) REFERENCES `businesses` (`id`) ON DELETE CASCADE,
